import React from "react";
import {Component} from "react";
import Layout from './layout'
import "./logoff.scss"
import history from "../index"
import { connect } from 'react-redux';

class LogoffComponent extends Component {
  constructor(props) {
    super(props);

    // // this.state = {
    // //   hidden: true,
    // //   password: ""
    // };
  }

submitStay = () => {
    // if(true) // In case we want to check something
    // history.back();
    history.push("/projects");
}

submitLogout = () => {
    history.push("/");
}

  render() {
    // console.log('RENDER');
    // console.log('this props ? ', this.props);
    return (
        <div className="logoff-container">
            <div className='logoff-header'>
                <div className="logoff-header-text">Logout</div>
                <div className='logoff-header-x'/>
            </div>
            <div className="logoff-body-container">
                <div className='logoff-body-text'>Are you sure you want to log out from Projectory?</div>
                <div className='logoff-bottom-container'>
                    <div className='logoff-bottom-logout-text' onClick={this.submitLogout}>Logout</div>
                    <div className='logoff-bottom-stay-text' onClick={this.submitStay}>Stay</div>
                </div>
            </div>
        </div>
    );
  }
}

export default LogoffComponent;
